import React, { useState } from "react";
import { StyleSheet, View, Text, TouchableOpacity } from "react-native";

function HomeScreen() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Home!</Text>
    </View>
  );
}

export default HomeScreen;
